import logo from './logo.svg';
import './App.css';
import AppBar from '@material-ui/core/AppBar';
function App() {
  return (
    <div className="App">
       <AppBar color="primary" position="static">
          <h1>My header</h1>
        </AppBar>
    </div>
  );
}

export default App;
